import { BrowserRouter as  Router, Route } from "react-router-dom";
import Home from "./pages/home";
import ExpenseTracker from "./pages/ExpenseTracker";


function App() {

  return (
      <div className="App">
        <Router>
            <Route path="/" exact>
              <Home />
            </Route>
            <Route path="/products" exact>
              <ExpenseTracker />
            </Route> 
        </Router>
      </div>
  );
}
export default App;
